import React, { useState } from 'react'
export function Test() {
	const [likes, setLikes] = useState(0)
	function increment() {
		setLikes(likes + 1)
		console.log(likes)
	}
	function decrement() {
		setLikes(likes - 1)
		console.log(likes)
	}
	return (
		<>
			<div>
				<p>{likes}</p>
				<button onClick={increment}>Plus</button>
				<button onClick={decrement}>Minus1</button>
			</div>
		</>
	)
}
